// src/components/SearchList.js

import React from 'react';
import Menus from './Menus';


function SearchList({ menus }) {
  const filtered = menus.map((menu) => <Menus key={menu.id} menu={menu} masukkeranjang={this.masukkeranjang}/>)
  return (
<div>
{filtered}
</div>
        
        
    
  );

}
  
  

export default SearchList;
